import logo from './platzi.webp';
import './App.css';
// when the function name starts with a capital letter it is 99% a REACT component
function App() {
  return (
    //we used xml width js
    //labels in lowercase convert them into REACT elements, then transform REACT component
    <div className="App">

      <TodoItem/>
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edita el archivo <code>src/App.js</code> y guarda para recargar.
        </p>
        <a
          className="App-link"
          href="https://platzi.com/reactjs"
          target="_blank"
          rel="noopener noreferrer"
        >
          Aprender React
        </a>
      </header>
    </div>
  );
}

function TodoItem(){
  return (
    <li>
      <span>V</span>
      <p>Llorar por la Llorana</p>
      <span>X</span>
    </li>
  );
}

export default App;
